import React from 'react';
import UserStats from './UserStats';
import LevelBanner from './LevelBanner';
import LevelPath from './LevelPath';
import Locked from '../../assets/images/locked.svg';
import Completed from '../../assets/images/completed.svg';
import CurrentLevel from '../../assets/images/current-level.svg';

function UserProgress() {
    return (
        <section className='px-10 bg-gray-50 py-10 w-full'>
            <h1 className='text-xl font-bold'>Welcome back, User!</h1>
            <div className='flex justify-between'>
                <div className='w-2/3'>
                    <LevelBanner
                        level='easy'
                        title='Baby Steps'
                        description='Master the fundamentals and build a strong foundation.'
                    />
                    <LevelPath 
                        status='completed'
                        image={Completed}
                    />
                    <LevelPath 
                        status='current'
                        image={CurrentLevel}
                    />
                    <LevelPath 
                        status='locked'
                        image={Locked}
                    />
                    <LevelBanner
                        level='moderate'
                        title='Challenge Accepted!'
                        description='Put your skills to the test with increasing difficulty.'
                    />
                    <LevelBanner
                        level='hard'
                        title='Mastermind in the Making'
                        description='Hone your skills and become a true expert.'
                    />
                </div>
                <UserStats />
            </div>
        </section>
    );  
}

export default UserProgress;
